import "./Notes.css";
import Note from "./Note";

export default function Notes(props) {
  console.log("props", props.notes[0]);
  const { notes } = props;
  console.log(notes);



  return (
    <div className="notes">
      <Note id={notes[0].id} title={notes[0].title} text={notes[0].title} />
      <Note id={notes[1].id} title={notes[1].title} text={notes[1].title} />
    </div>
  );
}
